import React, { useState } from 'react';

const FacultyRegister = () => {
    const [formData, setFormData] = useState({
        name: '',
        email: '',
        password: '',
        branch: '',
        handlingYears: '',
        subjectNames: '',
        subjectCodes: '',
    });

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value,
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Handle registration logic here (e.g., send to API)
    };

    return (
        <form onSubmit={handleSubmit}>
            <input type="text" name="name" placeholder="Name" value={formData.name} onChange={handleChange} required />
            <input type="email" name="email" placeholder="Email" value={formData.email} onChange={handleChange} required />
            <input type="password" name="password" placeholder="Password" value={formData.password} onChange={handleChange} required />
            <input type="text" name="branch" placeholder="Branch" value={formData.branch} onChange={handleChange} required />
            <input type="text" name="handlingYears" placeholder="Handling Years" value={formData.handlingYears} onChange={handleChange} required />
            <input type="text" name="subjectNames" placeholder="Subject Names" value={formData.subjectNames} onChange={handleChange} required />
            <input type="text" name="subjectCodes" placeholder="Subject Codes" value={formData.subjectCodes} onChange={handleChange} required />
            <button type="submit">Register</button>
        </form>
    );
};

export default FacultyRegister;
